import React from "react";
import RadioButtons from "./Radiobuttons";

function App() {
  const [radioButtons] = useState([
    {
      category: "audio",
      choices: ["acoustic", "cinematic", "rock"]
    },
    {
      category: "images",
      choices: ["acoustic", "cinematic", "rock"]
    },
    {
      category: "audio",
      choices: ["acoustic", "cinematic", "rock"]
    }
  ]);

  return (
    <div className="App">
      <RadioButtons />
      <RadioButtons />
      <RadioButtons />
    </div>
  );
}

export default App;
